jenkins:
  agentProtocols:
  - "JNLP4-connect"
  - "Ping"
  authorizationStrategy:
    globalMatrix:
      permissions:
      - "USER:Agent/Build:anykey"
      - "USER:Agent/Configure:anykey"
      - "USER:Agent/Connect:anykey"
      - "USER:Agent/Create:anykey"
      - "USER:Agent/Delete:anykey"
      - "USER:Agent/Disconnect:anykey"
      - "USER:Credentials/Create:anykey"
      - "USER:Credentials/Delete:anykey"
      - "USER:Credentials/ManageDomains:anykey"
      - "USER:Credentials/Update:anykey"
      - "USER:Credentials/View:anykey"
      - "USER:Job/Build:anykey"
      - "USER:Job/Cancel:anykey"
      - "USER:Job/Configure:anykey"
      - "USER:Job/Create:anykey"
      - "USER:Job/Delete:anykey"
      - "USER:Job/Discover:anykey"
      - "USER:Job/Move:anykey"
      - "USER:Job/Read:anykey"
      - "USER:Job/Workspace:anykey"
      - "USER:Overall/Administer:anykey"
      - "USER:Overall/Read:anykey"
      - "USER:Run/Delete:anykey"
      - "USER:Run/Replay:anykey"
      - "USER:Run/Update:anykey"
      - "USER:SCM/Tag:anykey"
      - "USER:View/Configure:anykey"
      - "USER:View/Create:anykey"
      - "USER:View/Delete:anykey"
      - "USER:View/Read:anykey"
  crumbIssuer:
    standard:
      excludeClientIPFromCrumb: false
  disableRememberMe: false
  globalNodeProperties:
  - envVars:
      env:
      - key: "GIT_APP_REPO"
        value: "https://github.com/anykey-igor/test-fastapi.git"
      - key: "IMAGE"
        value: "ianikeiev/fastapi"
      - key: "PROD_IP"
        value: "35.158.101.144"
      - key: "PROD_USER"
        value: "ubuntu"
  labelAtoms:
  - name: "built-in"
  - name: "jenkins_node"
  - name: "ubuntu"
  markupFormatter: "plainText"
  mode: NORMAL
  myViewsTabBar: "standard"
  nodes:
  - permanent:
      labelString: "ubuntu"
      launcher:
        ssh:
          credentialsId: "j_worker"
          host: "3.68.68.137"
          port: 22
          sshHostKeyVerificationStrategy:
            manuallyTrustedKeyVerificationStrategy:
              requireInitialManualTrust: false
      name: "jenkins_node"
      nodeDescription: "Jenkins_node"
      numExecutors: 2
      remoteFS: "/home/ubuntu/jenkins"
      retentionStrategy: "always"
  numExecutors: 2
  primaryView:
    all:
      name: "all"
  projectNamingStrategy: "standard"
  quietPeriod: 5
  remotingSecurity:
    enabled: true
  scmCheckoutRetryCount: 0
  securityRealm:
    local:
      allowsSignup: false
      enableCaptcha: false
      users:
      - id: "anykey"
        name: "Ihor Anikeiev"
        properties:
        - "apiToken"
        - "myView"
        - preferredProvider:
            providerId: "default"
        - "timezone"
        - mailer:
            emailAddress: "anikeev.ihor@gmail.com"
  slaveAgentPort: 50000
  updateCenter:
    sites:
    - id: "default"
      url: "https://updates.jenkins.io/update-center.json"
  views:
  - all:
      name: "all"
  viewsTabBar: "standard"
globalCredentialsConfiguration:
  configuration:
    providerFilter: "none"
    typeFilter: "none"
security:
  apiToken:
    creationOfLegacyTokenEnabled: false
    tokenGenerationOnCreationEnabled: false
    usageStatisticsEnabled: true
  gitHostKeyVerificationConfiguration:
    sshHostKeyVerificationStrategy: "knownHostsFileVerificationStrategy"
  globalJobDslSecurityConfiguration:
    useScriptSecurity: true
  sSHD:
    port: -1
unclassified:
  buildDiscarders:
    configuredBuildDiscarders:
    - "jobBuildDiscarder"
  buildStepOperation:
    enabled: false
  fingerprints:
    fingerprintCleanupDisabled: false
    storage: "file"
  gitHubConfiguration:
    apiRateLimitChecker: ThrottleForNormalize
  gitHubPluginConfig:
    configs:
    - credentialsId: "gitHub_token"
      name: "gitserv"
    hookUrl: "http://3.67.204.21:8080/github-webhook/"
  gitSCM:
    addGitTagAction: false
    allowSecondFetch: false
    createAccountBasedOnEmail: false
    disableGitToolChooser: false
    hideCredentials: false
    showEntireCommitSummaryInChanges: false
    useExistingAccountWithSameEmail: false
  globalTimeOutConfiguration:
    operations:
    - "abortOperation"
  junitTestResultStorage:
    storage: "file"
  locale:
    ignoreAcceptLanguage: false
  location:
    adminAddress: "address not configured yet <nobody@nowhere>"
    url: "http://jenkins.younet.com.ua/"
  mailer:
    charset: "UTF-8"
    useSsl: false
    useTls: false
  pollSCM:
    pollingThreadCount: 10
  timestamper:
    allPipelines: false
    elapsedTimeFormat: "'<b>'HH:mm:ss.S'</b> '"
    systemTimeFormat: "'<b>'HH:mm:ss'</b> '"
tool:
  git:
    installations:
    - home: "git"
      name: "Default"
  mavenGlobalConfig:
    globalSettingsProvider: "standard"
    settingsProvider: "standard"